import React  from "react";
import {Col, Container, Row} from "react-bootstrap";
import PhotoList from "../components/PhotoList";
import TypePic from "../components/typebar";

const Photogallery =()=>{
    return (
       <Container>
           <Row>
               <Col md={3}>
               <TypePic></TypePic>
               </Col>
               <Col md={9}>
               <PhotoList></PhotoList>
               </Col>
           </Row>
        </Container>
    )
};

export default Photogallery;
